/**
 * @suppress
 */
public object FfiConverterTypeWorldId: FfiConverter<WorldId, Pointer> {

    override fun lower(value: WorldId): Pointer {
        return value.uniffiClonePointer()
    }

    override fun lift(value: Pointer): WorldId {
        return WorldId(value)
    }

    override fun read(buf: ByteBuffer): WorldId {
        // The Rust code always writes pointers as 8 bytes, and will
        // fail to compile if they don't fit.
        return lift(Pointer(buf.getLong()))
    }

    override fun allocationSize(value: WorldId) = 8UL

    override fun write(value: WorldId, buf: ByteBuffer) {
        // The Rust code always expects pointers written as 8 bytes,
        // and will fail to compile if they don't fit.
        buf.putLong(Pointer.nativeValue(lower(value)))
    }
}



