sealed class StorageException: kotlin.Exception() {
    
    /**
     * Errors coming from the device keystore.
     */
    class Keystore(
        
        val v1: kotlin.String
        ) : StorageException() {
        override val message
            get() = "v1=${ v1 }"
    }
    
    /**
     * Errors coming from the blob store.
     */
    class BlobStore(
        
        val v1: kotlin.String
        ) : StorageException() {
        override val message
            get() = "v1=${ v1 }"
    }
    
    /**
     * Errors coming from the storage lock.
     */
    class Lock(
        
        val v1: kotlin.String
        ) : StorageException() {
        override val message
            get() = "v1=${ v1 }"
    }
    
    /**
     * Serialization/deserialization failures.
     */
    class Serialization(
        
        val v1: kotlin.String
        ) : StorageException() {
        override val message
            get() = "v1=${ v1 }"
    }
    
    /**
     * Cryptographic failures (AEAD, HKDF, etc.).
     */
    class Crypto(
        
        val v1: kotlin.String
        ) : StorageException() {
        override val message
            get() = "v1=${ v1 }"
    }
    
    /**
     * Invalid or malformed account key envelope.
     */
    class InvalidEnvelope(
        
        val v1: kotlin.String
        ) : StorageException() {
        override val message
            get() = "v1=${ v1 }"
    }
    
    /**
     * Unsupported envelope version.
     */
    class UnsupportedEnvelopeVersion(
        
        val v1: kotlin.UInt
        ) : StorageException() {
        override val message
            get() = "v1=${ v1 }"
    }
    
    /**
     * Errors coming from the vault database.
     */
    class VaultDb(
        
        val v1: kotlin.String
        ) : StorageException() {
        override val message
            get() = "v1=${ v1 }"
    }
    
    /**
     * Errors coming from the cache database.
     */
    class CacheDb(
        
        val v1: kotlin.String
        ) : StorageException() {
        override val message
            get() = "v1=${ v1 }"
    }
    
    /**
     * Leaf index mismatch during initialization.
     */
    class InvalidLeafIndex(
        
        /**
         * Leaf index stored in the vault.
         */
        val `expected`: kotlin.ULong, 
        
        /**
         * Leaf index provided by the caller.
         */
        val `provided`: kotlin.ULong
        ) : StorageException() {
        override val message
            get() = "expected=${ `expected` }, provided=${ `provided` }"
    }
    
    /**
     * Vault database integrity check failed.
     */
    class CorruptedVault(
        
        val v1: kotlin.String
        ) : StorageException() {
        override val message
            get() = "v1=${ v1 }"
    }
    
    /**
     * Storage has not been initialized yet.
     */
    class NotInitialized(
        ) : StorageException() {
        override val message
            get() = ""
    }
    
    /**
     * Nullifier already disclosed for a different request.
     */
    class NullifierAlreadyDisclosed(
        ) : StorageException() {
        override val message
            get() = ""
    }
    
    /**
     * Credential not found in the vault.
     */
    class CredentialNotFound(
        ) : StorageException() {
        override val message
            get() = ""
    }
    
    /**
     * Unexpected `UniFFI` callback error.
     */
    class UnexpectedUniFfiCallbackException(
        
        val v1: kotlin.String
        ) : StorageException() {
        override val message
            get() = "v1=${ v1 }"
    }
    

    companion object ErrorHandler : UniffiRustCallStatusErrorHandler<StorageException> {
        override fun lift(error_buf: RustBuffer.ByValue): StorageException = FfiConverterTypeStorageError.lift(error_buf)
    }

    
}

/**
 * @suppress
 */
public object FfiConverterTypeStorageError : FfiConverterRustBuffer<StorageException> {
    override fun read(buf: ByteBuffer): StorageException {
        

        return when(buf.getInt()) {
            1 -> StorageException.Keystore(
                FfiConverterString.read(buf),
                )
            2 -> StorageException.BlobStore(
                FfiConverterString.read(buf),
                )
            3 -> StorageException.Lock(
                FfiConverterString.read(buf),
                )
            4 -> StorageException.Serialization(
                FfiConverterString.read(buf),
                )
            5 -> StorageException.Crypto(
                FfiConverterString.read(buf),
                )
            6 -> StorageException.InvalidEnvelope(
                FfiConverterString.read(buf),
                )
            7 -> StorageException.UnsupportedEnvelopeVersion(
                FfiConverterUInt.read(buf),
                )
            8 -> StorageException.VaultDb(
                FfiConverterString.read(buf),
                )
            9 -> StorageException.CacheDb(
                FfiConverterString.read(buf),
                )
            10 -> StorageException.InvalidLeafIndex(
                FfiConverterULong.read(buf),
                FfiConverterULong.read(buf),
                )
            11 -> StorageException.CorruptedVault(
                FfiConverterString.read(buf),
                )
            12 -> StorageException.NotInitialized()
            13 -> StorageException.NullifierAlreadyDisclosed()
            14 -> StorageException.CredentialNotFound()
            15 -> StorageException.UnexpectedUniFfiCallbackException(
                FfiConverterString.read(buf),
                )
            else -> throw RuntimeException("invalid error enum value, something is very wrong!!")
        }
    }

    override fun allocationSize(value: StorageException): ULong {
        return when(value) {
            is StorageException.Keystore -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
                + FfiConverterString.allocationSize(value.v1)
